import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // Create and use this CSS file for the styling

const Home = () => {
  return (
    <div className="home-container">
      <h1 className="home-title">Fruit.AI</h1>
      <p className="home-subtitle">Be Healthy!</p>
      <div className="home-links">
        <Link to="/chatbot" className="home-link">Chat.</Link>
        <Link to="/translator" className="home-link">Gx.</Link>
        <Link to="/faq" className="home-link">FAQs</Link>
        <Link to="/about" className="home-link">About</Link>
      </div>
    </div>
  );
};

export default Home;
